import Link from 'next/link'

export default function Nav({ newGame }) {
  return (
    <nav>
      <div className="container mx-auto px-6 py-2 flex justify-between items-center">
        <Link className="text-2xl lg:text-4xl" href="#">
          CODENAMES
        </Link>
        <a className="px-4 font-bold" onClick={newGame}>New Game</a>
      </div>
    </nav>
  )
}
